    constructor(props){
        super(props)

        this.state = {
            rentalitems: []
        }
    }

    itemdetail(rentalitemid){
        this.props.history.push(`/item-detail/${rentalitemid}`);
    } 

    componentDidMount(){
          RentalItemService.getRentalItems().then((res) => {
              this.setState({rentalitems: res.data});
          });
    }

    render() {
        return (
