                                                        <div className="vmCard-content">

                                                            <div className="vmCard-title">
                                                                <h3> {rentalitem.name} </h3>
                                                                <h6> {rentalitem.description} </h6>
                                                            </div>

                                                            <div className="vmCard-body">
                                                                <p> {rentalitem.rentalperday} /perDay </p>
                                                            </div>

                                                        </div>

                                                        <div className="vmBtn" >
